import React from 'react';
import './queryFilterPanel.css';

export default function QueryFilterPanel() {
    return (
        <div>
            <div className="queryFilterHeaderDiv">
                <h2>Filter By Custom Query:</h2>
            </div>
            <input type="text" name="" id="customQueryInputField" />
        </div>
    )
}
